import React from 'react'
import { Link } from 'react-router-dom'

export const Navbar = () => {
  return (
    <nav>
      <div className="nav-brand">
        <h2>
          <Link to="/">Mathew Gries DOTCOM</Link>
        </h2>
      </div>
    </nav>
  )
}
